  \"Water Temperature, conductivity, and currents data collected by CTDs and current
  meters on moored buoys in the Sermilik Fjord, Greenland from 2012-09-18 to 2013-08-20
  (NCEI Accession 0127325)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-02-26T22:15:57.426944\",\n\t\"name\": \"water-temperature-conductivity-and-currents-data-collected-by-ctds-and-current-meters-on-m-08e55\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The data included in this dataset were
  collected in the Sermilik Fjord, located in East Greenland in the Ammassalik district
  close to the town of Tasiilaq. Data collection was conducted by deploying five moorings
  from September 2012 to August 2013. One mooring was not recovered. The four recovered
  moorings were named CM0, CM1, CM5, and SF4. Mooring CM0 was located mid-fjord at
  a depth of 125 meters and was equipped with an SBE MicroCAT, an RBR DR-1050, and
  an Onset U-22 ProV2. Mooring CM1 was located next to CM0 at a depth of 125 meters.
  It was equipped with an SBE MicroCAT, an RBR DR-1050, and an Onset UTBI-001 TidbiT.
  Mooring CM5 was located outside of the fjord entrance at a depth of 290 meters.
  It was equipped with an SBE MicroCAT and a Nortek Aquadopp. Mooring SF4 was positioned
  in the middle of the fjord at a depth of 880 meters. Data collected from this mooring
  included two RBR XR-420s, ten Onset UTBI-001 Temperature Loggers, two SBE MicroCAT,
  an RBR DR-1050, a Nortek Aquadopp, and an RDI LR-ADCP.\",\n\t\"license_title\":
